import React, { Component } from 'react';
// import ReactDOM from "react-dom";
import './App.css';

class Header extends Component {
  render () {
    return(
      <div class="header">
        This is the header.
      </div>
    )
  }
}

class App extends Component {
  render() {
    return(
      <Header />
    )
  }
}

export default App;
